CREATE VIEW sev_permissaousuario AS
 SELECT us.idusuario,
    us.nome,
    us.usuario,
    us.nivel,
        CASE
            WHEN (us.nivel = 'A'::bpchar) THEN 'Administrador'::text
            ELSE 'Usuário'::text
        END AS tiponivel,
    gp.idgrupopermissao,
    gp.descricao AS descricaogrupo,
    ga.idaplicacao,
    ap.descricao AS descricaoaplicacao,
    ga.abrir,
    ga.insert,
    ga.update,
    ga.delete,
    gp.ativo AS grupoativo
   FROM se_usuario us,
    se_grupopermissao gp,
    se_grupousuperm gu,
    se_grupoapliperm ga,
    ge_aplicacao ap
  WHERE ((us.idusuario = gu.idusuario) AND (gp.idgrupopermissao = gu.idgrupopermissao) AND (gu.idgrupousuperm = ga.idgrupousuperm) AND (ga.idaplicacao = ap.idaplicacao) AND (gp.ativo = 'S'::bpchar));


ALTER TABLE sev_permissaousuario OWNER TO postgres;

